        if(pending > 0){           
            payable(wallet).transfer(msg.value);        
            safeGoodTransfer(msg.sender,pending);
            emit Withdraw(msg.sender, pending);
        }else{
			payable(wallet).transfer(msg.value); 
		}


        require(tokenIds.length > 0, "At least one token ID must be provided");
        for (uint i = 0; i < tokenIds.length; i++) {
